	vid.autoplay = true;
	document.getElementById("myVideo").load();

}

function myFunction() {
  document.getElementById("myVideo").load();
}


export default () => (
	<div className='landing'>
		<div className='info'>
		<video controls width="250">

	    <source src="https://interactive-examples.mdn.mozilla.net/media/examples/flower.mp4"
	            type="video/mp4">
</source>
	    Sorry, your browser doesn't support embedded videos.
	</video>


		<h2>
		New Wave
		</h2>
		<h3>Property Group</h3>
			<p class="animated fadeInUp">We take your dream home and make it real.</p>
			<Link to='/contactpage'>
			<button className="button1">BOOK YOUR CONSULTATION</button>
			</Link>

		</div>
	</div>
);
